    <div class="col-form">
      <q-card class="login-card text-white" v-show="trigger.showLoginForm">
        <q-card-section>
          <q-form class="login-form">
            <q-input
              hide-bottom-space
              lazy-rules
              outlined
              bg-color="white"
              class="email-input"
              color="orange-8"
              placeholder="Email"
              ref="userEmailRef"
              v-model="loginForm.user_email"
              :rules="rules"
            >
              <template v-slot:prepend>
                <q-icon name="mail" color="orange-8" />
              </template>
            </q-input>

            <q-input
              hide-bottom-space
              lazy-rules
              outlined
              bg-color="white"
              class="password-input"
              color="orange-8"
              placeholder="Password"
              ref="userPasswordRef"
              v-model="loginForm.user_password"
              :rules="rules"
              :type="isPwd ? 'password' : 'text'"
            >
              <template v-slot:prepend>
                <q-icon name="lock" color="orange-8" />
              </template>
              <template v-slot:append>
                <q-icon
                  class="cursor-pointer"
                  color="orange-8"
                  :name="isPwd ? 'visibility_off' : 'visibility'"
                  @click="showPassword"
                />
              </template>
            </q-input>

            <q-btn
              class="login-button text-capitalize"
              label="Sign In"
              target="_self"
              @click="signin"
            />
          </q-form>
        </q-card-section>

        <q-card-section class="lower-buttons">
          <q-btn
            flat
            class="login-no-account text-capitalize"
            color="white"
            label="Don't have an account?"
            size="sm"
            @click="registerForm"
          />
          <q-btn
            flat
            class="login-forgot-account text-capitalize"
            color="white"
            label="Forgot password?"
            size="sm"
            @click="forgotPasswordForm"
          />
        </q-card-section>
      </q-card>

      <router-view />
    </div>
  </div>
</template>

<script src="../script/Log-in.js"></script>

<style lang="scss" scoped>
@import "../style/Log-in.scss";
</style>
